import React, { Component } from 'react';
import './App.css';
import Layout from './components/Layout/Layout'
import Burgerbuilder from './containers/BurgerBuilder/Burgerbuilder';

class App extends Component {
  render() {
    return (
      <div>
        <Layout>
          <Burgerbuilder/>
        </Layout>
      </div>
    );
  }
}

export default App;
